pragma solidity ^0.6.0;

contract SimpleStorage {

    //this will get initialized to 0!
    //unit is an integer that is >= 0
    uint256 public favoriteNumber;

    //Struct like C langage
    struct People{
        uint256 favoriteNumber;
        string name;
    }

    //public means that everybody can access to this variable
    // [] is dynamic array allocation
    People[] public people;

    //we associate to each name an favorite number
    mapping(string => uint256) public nameToFavoriteNumber;

    //function permitting to store a number
    function store(uint256 _favoriteNumber) public{
        favoriteNumber = _favoriteNumber;
    }

    //function permitting to retrieve a number
    // view is used for functions that only views data
    function retrieve() public view returns(uint256){
        return favoriteNumber;
    }

    //function permitting to add a new person with a favorite number
    function addPerson(string memory _name, uint256 _favoriteNumber) public{
        //we add a new person
        people.push(People(_favoriteNumber, _name));
        //then we map name to favorite number
        nameToFavoriteNumber[_name] = _favoriteNumber;
    }
}
